import React from 'react';
import { NavLink } from 'react-router-dom';

import './NavBar.css';

const navBar = props => {
  return (
    <div className='NavBar'>
        <NavLink to='/' activeClassName='NavBar__Active'>Home</NavLink>
        <NavLink to='/crisps' activeClassName='NavBar__Active'>Crisps</NavLink>
        <NavLink to='/chocolate' activeClassName='NavBar__Active'>Chocolate</NavLink>
        <NavLink to='/lollipop' activeClassName='NavBar__Active'>Lollipop</NavLink>
    </div>
  )
}

export default navBar;
